import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

class main_nav extends Component {
  render() {
    return (
      <div>
        <nav className="navbar bg-body-tertiary">
        <div id="logo">
          <a href="#" className="navbar-brand"><img src="/images/logo.png" alt="logo"></img></a>
        </div>
        <ul id="nav" className="nav justify-content-end">
            <li className="nav-item"><a class="nav-link" href="#!">Projects</a></li>
            <li className="nav-item"><a class="nav-link" href="#!">NFTs</a></li>
            <li className="nav-item"><a class="nav-link" href="#!">NEWS</a></li>
            <li className="nav-item"><a class="nav-link" href="#!">ABOUT</a></li>
            <li className="nav-item"><a class="nav-link" href="#!">CONTACT</a></li>
        </ul>
        </nav>
      </div>
    );
  }
}

export default main_nav;
